import { useState } from "react";
import { Text, Touchable, TouchableHighlight } from "react-native";
import { CalendarIcon, GraphIcon, HomeIcon } from "../../components/icons";
import DateNavigation from "./date-navigation";
import Exercises from "./exercises";

const DayWorkout = () => {
    const [a,b] = useState(true);

    return (<>
        <DateNavigation/>
        <TouchableHighlight onPress={() => b(!a)}><Text>String(a)</Text></TouchableHighlight>
        <Exercises/>
    </>);
}

export default DayWorkout;
